import React, { useState } from "react";
import "../../../../public/calidad.css";
import { Button } from "carbon-components-react";
import { RadioButtonGroup } from "carbon-components-react";
import { RadioButton } from "carbon-components-react";
import { ProgressIndicator } from "carbon-components-react";
import { ProgressStep } from "carbon-components-react";
import { Form } from "carbon-components-react";
import { TextInput } from "carbon-components-react";
import { TextArea } from "carbon-components-react";
import { Select } from "carbon-components-react";
import { SelectItem } from "carbon-components-react";
import { Tooltip } from "carbon-components-react";
import { DatePicker } from "carbon-components-react";
import { DatePickerInput } from "carbon-components-react";
import { Checkbox } from "carbon-components-react";

var text = "";

function MyComponent() {
  const [holdTime, setState] = useState(0);

  // setInterval(update, 1000);
  const now = new Date().toLocaleTimeString();

  const [time, setTime] = React.useState(now);
  const [counter, setCounter] = useState(0);

  function update() {
    setCounter(counter + 1);
    const newT = new Date().toLocaleTimeString();
    setTime(newT);

    var refreshIntervalId = setInterval(update, 1000);
    if (counter % 2 !== 0) {
      text = <h1>es par</h1>;
      setInterval(refreshIntervalId);
    } else {
      text = <h1>es inpar</h1>;
      clearInterval(refreshIntervalId);
    }
  }

  function increase() {
    setState(holdTime + 1);
  }
  function decrease() {
    setState(holdTime - 1);
  }

  return (
    <div>
      <h1>Calidad</h1>
      <div className="some-container">
        <label>Tiempo en Hold</label>
        <h1>{counter}</h1>
        <h1>{time}</h1>
        <li>{text}</li>

        <Button kind="ghost" onClick={increase}>
          {" "}
          +{" "}
        </Button>
        <Button kind="ghost" onClick={decrease}>
          {" "}
          -{" "}
        </Button>
        <Button onClick={update}> setHold </Button>

        <ProgressIndicator currentIndex={1}>
          <ProgressStep
            label="First step"
            description="Step 1: Getting started with Carbon Design System"
          />
          <ProgressStep
            current
            label="Second step with tooltip"
            description="Step 2: Getting started with Carbon Design System"
            renderLabel={() => (
              <Tooltip
                direction="bottom"
                showIcon={false}
                triggerClassName="bx--progress-label"
                triggerText="Second step with tooltip"
                tooltipId="tooltipId-0"
              >
                <p>Second step with tooltip</p>
              </Tooltip>
            )}
          />
          <ProgressStep
            label="Third step"
            description="Step 3: Getting started with Carbon Design System"
            secondaryLabel="Optional label"
          />
          <ProgressStep
            invalid
            label="Fourth step"
            description="Step 4: Getting started with Carbon Design System"
          />
          <ProgressStep
            disabled
            label="Fifth step"
            description="Step 5: Getting started with Carbon Design System"
          />
        </ProgressIndicator>
      </div>
      <Form>
        <div style={{ paddingLeft: "100px" }}>
          <br />
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            <DatePicker datePickerType="single">
              <DatePickerInput
                placeholder="mm/dd/yyyy"
                labelText="*Incoming"
                id="date-picker-single"
                // hideLabel="true"
                style={{ width: "150px" }}
              />
            </DatePicker>

            <div style={{ margin: "0 20px" }}>
              <Select
                style={{ width: "200px" }}
                invalidText="This is an invalid error message."
                labelText="*R.Incoming"
                // hideLabel="true"
                className="size"
              >
                <SelectItem
                  width="150px"
                  text="Griselda R."
                  value="Griselda R."
                />
                <SelectItem width="150px" text="German V." value="German V." />
                <SelectItem width="150px" text="Laura E." value="Laura E." />
                <SelectItem width="150px" text="Edith H." value="Edith H." />
              </Select>
            </div>
            <div style={{ margin: "0 2rem 0 0" }}>
              <TextInput
                style={{ width: "auto", margin: "0 10px" }}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                // id="test2"
                invalidText="Invalid error message."
                labelText="Num.HDD"
                placeholder="Num.HDD"
                // hideLabel="true"
              />
            </div>
            <div style={{ margin: "0 2rem 0 0" }}>
              <TextInput
                style={{ width: "auto", margin: "0 10px" }}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                // id="test2"
                invalidText="Invalid error message."
                labelText="Num.SDD"
                placeholder="Num.SDD"
                // hideLabel="true"
              />
            </div>
            <div>
              <TextInput
                style={{ width: "auto", margin: "0 10px" }}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                // id="test2"
                invalidText="Invalid error message."
                labelText="Validación de VPD's"
                placeholder="Validación de VPD's"
                // hideLabel="true"
              />
            </div>
          </div>
          {/* aqui termina Incoming,Rincoming,HDD,SDD,VPD */}
          <br />
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            {/* aqui nicia el radioBtn */}
            <label>Auditado por:</label>
            <br />

            <RadioButtonGroup
              legendText="Radio button heading"
              name="radio-button-group"
              defaultSelected="radio-1"
            >
              <RadioButton labelText="ESS" value="ESS" id="radio-1" />
              <RadioButton labelText="RM" value="RM" id="radio-2" />
            </RadioButtonGroup>
          </div>
          {/* aqui termina Serie de nodos*/}
          <br />
          <label style={{ color: "black", display: "flex", margin: "0 10px" }}>
            <strong>Serie de nodos</strong>
          </label>
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            {/* aqui nicia el radioBtn */}

            <br />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="EMS1"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="EMS2"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO1"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO2"
              hideLabel="true"
            />
          </div>
          <br />
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"2
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO3"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO4"
              hideLabel="true"
            />

            <TextInput
