              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO5"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="ESSIO6"
              hideLabel="true"
            />
          </div>
          {/* aqui termina Serie de nodos*/}
          <br />
          <label style={{ color: "black", display: "flex", margin: "0 10px" }}>
            <strong>Serie de nodos</strong>
          </label>
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            {/* aqui nicia el radioBtn */}

            <br />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR01"
              hideLabel="true"
            />

            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR02"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"2
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR03"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR04"
              hideLabel="true"
            />
          </div>
          <br />
          <div style={{ display: "flex", margin: "0 10px", width: "350px" }}>
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR05"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR06"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR07"
              hideLabel="true"
            />
            <TextInput
              style={{ width: "auto", margin: "0 10px" }}
              helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
              // id="test2"
              invalidText="Invalid error message."
              labelText="Text input label"
              placeholder="PTR08"
              hideLabel="true"
            />
          </div>
          <br />

          <div style={{ display: "flex", margin: "0 10px", width: "850px" }}>
            <div className="contenedor">
              <label style={{ fontSize: "16px", margin: "50px 0 0px 0px" }}>
                Comentarios de calidad
              </label>

              <TextArea
                style={{ margin: "25px 0 25px 25px" }}
                cols={40}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                id="ConfigTextArea"
                invalidText="Invalid error message."
                // labelText="Configuracion"
                placeholder="Comentarios de calidad"
                rows={6}
              />
              <label style={{ fontSize: "16px", margin: "50px 0 0px 50px" }}>
                Otros ESSIO
              </label>
              <TextArea
                style={{ margin: "25px 0 25px 25px" }}
                cols={40}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                id="ComentariosTextArea"
                invalidText="Invalid error message."
                // labelText="Comentarios"
                placeholder="Otros ESSIO"
                rows={6}
              />
              <label style={{ fontSize: "16px", margin: "50px 0 0px 50px" }}>
                Detalles de Hold
              </label>
              <TextArea
                style={{ margin: "25px 0 25px 25px" }}
                cols={40}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                id="ComentariosTextArea"
                invalidText="Invalid error message."
                // labelText="Comentarios"
                placeholder="Detalles de Hold"
                rows={6}
              />
              <label style={{ fontSize: "16px", margin: "50px 0 0px 50px" }}>
                Solucion de Hold
              </label>
              <TextArea
                style={{ margin: "25px 0 25px 25px" }}
                cols={40}
                helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
                id="ComentariosTextArea"
                invalidText="Invalid error message."
                // labelText="Comentarios"
                placeholder="Solucion de Hold"
                rows={6}
              />
            </div>
            {/* aqui termina Config y comentarios Text Area*/}
          </div>

          <Button kind="primary" tabIndex={0} type="submit">
            Guardar
          </Button>
        </div>
      </Form>
    </div>
  );
}

function Calidad() {
  return (
    <div id="Calidad" class="tabcontent" style={{ color: "blue" }}>
      <MyComponent />
    </div>
  );
}

export default Calidad;
